import React, { Component } from "react";
import { AiFillFacebook } from "react-icons/ai";

class Footer extends Component {
  state = {};
  render() {
    return (
      <div>
        <div>
          <hr className="line"></hr>
        </div>

        <div>
          <AiFillFacebook
            size={30}
            style={{ color: "blue", justifyContent: "center" }}
          />
        </div>
      </div>
    );
  }
}

export default Footer;
